import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

const AppWithRouter = () => {
    return (
      <Router>
        <App/>
      </Router>
    );
  };


ReactDOM.render(<AppWithRouter />, document.getElementById('root'));
